toBool :: String -> Bool
toBool "false" = False
toBool "true" = True

{-|
    Parses the comment tokens in a list of tokens.
    Checks that the left and right comments are properly matched,
    and discards all tokens in properly commented regions.
-}
comment :: [Token] -> Int -> [Token]
comment (LCOMMENT p:ts) n = comment ts (n + 1)
comment (RCOMMENT p:ts) 0 = [(ERROR p "SyntaxError: Invalid comment close symbol")]
comment (RCOMMENT p:ts) n = comment ts (n - 1)
comment (t:ts) 0 = t:(comment ts 0)
comment (t:ts) n = comment ts n
comment [] 0 = []
comment [] _ = [(ERROR (AlexPn (-1) (-1) (-1)) "SyntaxError: Missing comment close symbol")]

data Token
  = ADD { pos :: AlexPosn }
  | SUB { pos :: AlexPosn }
  | MUL { pos :: AlexPosn }
  | DIV { pos :: AlexPosn }
  | ARROW { pos :: AlexPosn }
  | AND   { pos :: AlexPosn }
  | OR    { pos :: AlexPosn }
  | NOT   { pos :: AlexPosn }
  | EQUAL { pos :: AlexPosn }
  | LT    { pos :: AlexPosn }
  | GT    { pos :: AlexPosn }
  | LE    { pos :: AlexPosn }
  | GE    { pos :: AlexPosn }
  | ASSIGN  { pos :: AlexPosn }
  | LPAR { pos :: AlexPosn }
  | RPAR { pos :: AlexPosn }
  | CLPAR { pos :: AlexPosn }
  | CRPAR { pos :: AlexPosn }
  | SLPAR { pos :: AlexPosn }
  | SRPAR { pos :: AlexPosn }
  | SLASH { pos :: AlexPosn }
  | COLON { pos :: AlexPosn }
  | SEMICOLON { pos :: AlexPosn }
  | COMMA { pos :: AlexPosn }
  | IF { pos :: AlexPosn }
  | THEN { pos :: AlexPosn }
  | WHILE { pos :: AlexPosn }
  | DO { pos :: AlexPosn }
  | READ { pos :: AlexPosn }
  | ELSE { pos :: AlexPosn }
  | BEGIN { pos :: AlexPosn }
  | END { pos :: AlexPosn }
  | CASE { pos :: AlexPosn }
  | OF { pos :: AlexPosn }
  | PRINT { pos :: AlexPosn }
  | INT { pos :: AlexPosn }
  | BOOL { pos :: AlexPosn }
  | CHAR { pos :: AlexPosn }
  | REAL { pos :: AlexPosn }
  | VAR { pos :: AlexPosn }
  | DATA { pos :: AlexPosn }
  | SIZE { pos :: AlexPosn }
  | FLOAT { pos :: AlexPosn }
  | FLOOR { pos :: AlexPosn }
  | CEIL { pos :: AlexPosn }
  | FUN { pos :: AlexPosn }
  | RETURN { pos :: AlexPosn }
  | CID { pos :: AlexPosn, str :: String }
  | ID { pos :: AlexPosn, str :: String }
  | RVAL { pos :: AlexPosn, f :: Float }
  | IVAL { pos :: AlexPosn, i :: Int }
  | BVAL { pos :: AlexPosn, b :: Bool }
  | CVAL { pos :: AlexPosn, c :: Char }
  | LCOMMENT { pos :: AlexPosn }
  | RCOMMENT { pos :: AlexPosn }
  | ERROR { pos :: AlexPosn, str :: String }
  deriving (Eq, Show)

